package grail.compositeFigs;
import bus.uigen.OEFrame;
import bus.uigen.ObjectEditor;
import grail.compositeFigs.Gorges;

import grail.geometryFigs.MovingL;
import grail.geometryFigs.Point;
import grail.geometryFigs.RotatingLine;
import util.annotations.StructurePattern;
import util.annotations.StructurePatternNames;
@StructurePattern(StructurePatternNames.BEAN_PATTERN)

public class GorgeWithBrg implements Gorges {

	static final int 
		GORGE_RX = 850,
		GORGE_LX = 600,
		GORGE_Y = 0,
		ROTATE = -16,
		BRIDGE_WIDTH = 60;
	static final double
		ANG_GORGE = (Math.PI/2),
		GORGE_RAD = 1000;


	//Point topLine;
	MovingL leftLine;
	MovingL rightLine;
	MovingL bridgeULine;
	MovingL bridgeLLine;

	public GorgeWithBrg(){
		leftLine = new RotatingLine(GORGE_RAD, ANG_GORGE, GORGE_LX, GORGE_Y);
		rightLine = leftLine.clone();
		rightLine.move(GORGE_RX, 0);
		bridgeULine = new RotatingLine(GORGE_RX - GORGE_LX, GORGE_Y, GORGE_LX, (int)GORGE_RAD/2);
		bridgeLLine = bridgeULine.clone();
		bridgeLLine.move(GORGE_LX, bridgeULine.getY()+ BRIDGE_WIDTH);
	}


	public MovingL getleftLine() {return leftLine;}

	public MovingL getrightLine() {return rightLine;}

	public MovingL getbridgeULine() {return bridgeULine;}

	public MovingL getbridgeLLine() {return bridgeLLine;}


	public static void main(String[] args) {
		//MovingL gorgeLine = new RotatingLine(GORGE_RAD, (Math.PI/2), GORGE_LX, GORGE_Y);
		Gorges bridgeGorge = new GorgeWithBrg();
		OEFrame anOEFrame = ObjectEditor.edit(bridgeGorge);
    	anOEFrame.showTreePanel();
	}




}

package grail.compositeFigs;


import grail.geometryFigs.ACircle;
import grail.geometryFigs.CharHeads;
