import grail.compositeFigs.AnObservableHelper;
import tags301.Comp301Tags;
import util.annotations.EditablePropertyNames;
import util.annotations.PropertyNames;
import util.annotations.Tags;

@Tags(Comp301Tags.LOCATABLE)
@PropertyNames({"X", "Y"})
@EditablePropertyNames({"X", "Y"})


public class Alocatable implements Locatable {

	int x;
	int y;
	AnObservableHelper propertySupport = new AnObservableHelper();

	public int getX() {
		return x;
	}


	public int getY() {
		return y;
	}
	public void setX(int newX) {
		int oldX = getX();
		x = newX;
		propertySupport.notifyAllListeners(new PropertyChangeEvent(this, "X", oldX,
				newX));
	}

	public void setY(int newY) {
		int oldY = getY();
		y = newY;
		propertySupport.notifyAllListeners(new PropertyChangeEvent(this, "Y", oldY,
				newY));
	}
	public void addPropertyChangeListener(PropertyChangeListener aListener) {	 
		propertySupport.add(aListener);
	}

}

